import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Header = () => {
  return (
    <header className="bg-header text-white p-4">
     <div className="container mx-auto flex justify-between items-center">
        {/*Frase*/}
        <div className="text-1x1 font-bold">
            Reserve su pedido Ahora!
        </div>


        {/*Logo*/}
        <div className="absolute inset-0 flex justify-center items-center pointer-events-none">
          <div className="bg-secondary p-2 rounded-full">
           <a href="/" className="text-4xl font-bold text-primary pointer-events-auto">
           <img src={logo} alt="logo" />
           </a>
          </div>
        </div>

        {/* Menu */}
        <nav className="hidden md:flex space-x-8 font-bold">
          <a href="#home" className="hover:text-primary">Inicio</a>
          <a href="#about" className="hover:text-primary">La carta</a>
          <a href="#services" className="hover:text-primary">Reservar</a>
          <a href="#contact" className="hover:text-primary">Delivery</a>
          <a href="#contact" className="hover:text-primary">Contacto</a>
        </nav>

        {/* Menú móvil */}
        <div className="md:hidden">
          <button className="text-primary focus:outline-none">
            <FontAwesomeIcon icon="bars" />
          </button>
        </div>
     </div>
    </header>
  );
};

export default Header;
